    $('#picker').colpick({
        flat     : true,
        layout   : 'full',
        color    : 'ffffff',
        submit   : 0,
        onChange : function(hsb, hex, rgb, el, bySetColor) {
            var name = colorName(hex.toUpperCase(), rgb);
            // Change the page
            $('#colorname').html(name.key);
            $('#colorhex').html('#' + name.value.toLowerCase());
            $('#similarcolor').css('background', '#' + name.value);
        }
    }).keyup(function(){
        $(this).colpickSetColor(this.value);
    });
    /**
     * Find the color name or similar color name
     * @param  string   hex color hex, looks like: ffffff
     * @param  object   rgb color rgb, looks like: {r:255, g:0, b:0}
     * @return object   color object, looks like: {"key":"Abbey","value":"4C4F56"}
     */
    var colorName = function (hex, rgb) {
        var name = '', minDiff = 999999;
        for (var i = colors.length - 1; i >= 0; i--) {
            // If find the same value, end the loop
            if (colors[i].value === hex) {
                name = colors[i];
                break;
            } else {
                // get the color rgb
                var colorRGB = $.colpick.hexToRgb(colors[i].value); // {r:255, g:0, b:0}
                //  get the difference between two colors
                var diff = Math.sqrt(Math.pow((colorRGB.r - rgb.r), 2) + Math.pow((colorRGB.g - rgb.g), 2) + Math.pow((colorRGB.b - rgb.b), 2));
                if (diff < minDiff) {
                    minDiff = diff;
                    name = colors[i];
                }
            }
        };

        return name;
    }
